import React from 'react'

export default class ConfirmationPage extends React.Component {
    confirm = () => {
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ title: 'React POST Request Example' })
        };
        fetch('https://httpbin.org/post', requestOptions)
            .then(response => response.json())
            .then(data => console.log(data));
    }
    render() {
        return (
            <div>
                <div style={{flexDirection: 'column', width: '80%', height: '200px', display: "flex", justifyContent: "center", borderRadius: '5px', borderColor: 'black', backgroundColor: 'gainsboro', padding: '1rem'}}>
                    <div><span style={{fontWeight: "bold", color: "black"}}>Current Subscription:</span>6 Months Subscription</div>
                    <div><span style={{fontWeight: "bold", color: "black"}}>Total Amount: </span>5$</div>
                </div>
            </div>
        )
    }
}
